import styled from 'styled-components'

export const Container = styled.div`
	padding: 30px 0 0 0;
`;

export const ImageProfile = styled.img`
	width: 50px;
	display: block;
	margin: 0 auto;
	border-radius: 50%;
`;

export const TextName = styled.p`
	margin: 0;
	font-weight: 500;
`;

export const TextEmail = styled.p`
	font-weight: 200;
`;
